package main

import "fmt"

func step() bool {
	nrows := len(m)
	ncols := len(m[0])
	swapment := false

	swap := func(r1,c1,r2,c2 int) {
		m[r1][c1], m[r2][c2] = m[r2][c2], m[r1][c1]
		swapment = true
	}

	mark := func(r,c int) {
		m[r][c] = 'x'
	}

	unmark := func(r,c int) {
		if m[r][c] == 'x' {
			m[r][c] = '.'
		}
	}

	for r, _ := range m {
		for c := 0; c < ncols; c++ {
			if m[r][c] != '>' {
				continue
			}

			nc := (c+1) % ncols
			if m[r][nc] == '.' {
				swap(r,c,r,nc)
				if c == 0 {
					mark(r, 0)
				}
				c++
			}
		}
		unmark(r, 0)
	}

	for c := 0; c < ncols; c++ {
		for r := 0; r < nrows; r++ {
			if m[r][c] != 'v' {
				continue
			}
			nr := (r+1) % nrows
			if m[nr][c] == '.' {
				swap(r,c,nr,c)
				if r == 0 {
					mark(0, c)
				}
				r++
			}
		}
		unmark(0, c)
	}

	return swapment
}

func main() {
	i := 1
	for step() {
		i++
	}
	fmt.Println(i)
	// 482
}

